import { StyleSheet } from 'react-native';
import { HEADER_HEIGHT,STATUS_BAR_HEIGHT } from '../../styles/util';


const styles = StyleSheet.create({
  container: {
    flex: 1,
    paddingTop: STATUS_BAR_HEIGHT + 16,
    paddingLeft: 20,
    paddingRight: 20,
    backgroundColor: 'white'
  },
  img: {
    width: 41,
    height: 41,
    borderRadius: 10
  },
  toolbar:{
    display: 'flex',
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center'
  },
  title: {
    fontSize: 20,
    marginTop: 33
  },
  title_text: {
    fontSize: 20,
  },
  subtitle: {
    marginTop: 5,
    marginBottom: 16
  },
  subtitle_text: {
    opacity: 0.3,
    fontSize: 14,
    fontWeight: '400',
  },
});

export default styles;
